                            {nav ? (<NavLink to={"portfolio"}>
                                <button className={nav ? styles.navbtn :styles.navbtn}>Portfolio</button>
                            </NavLink>) : (<button className={nav ? styles.navbtn :styles.navbtn}>Portfolio</button>)} 
                            
