                            {nav ? (<NavLink to={"contact"}>
                                <button className={nav ? styles.navbtn :styles.navbtn}>Contact</button>
                            </NavLink>) : (<button className={nav ? styles.navbtn :styles.navbtn}>Contact</button>)}
                            
